  <title>CMW Group – Landscaping & Outdoor Design</title>
  <style>
    body {
      margin: 0;
      font-family: Arial, sans-serif;
      background-color: #f4f1ea;
      color: #3e3e3e;
    }
    header {
      background-color: #4b5d3a;
      color: #fff;
      padding: 2rem 1rem 1rem 1rem;
      text-align: center;
    }
    nav a {
      color: #fff;
      margin: 0 1rem;
      text-decoration: none;
      font-weight: bold;
    }
    .section {
      padding: 3rem 2rem;
      text-align: center;
    }
    footer {
      background-color: #4b5d3a;
      color: #fff;
      text-align: center;
      padding: 2rem;
      margin-top: 3rem;
    }
    .services {
      display: flex;
      flex-wrap: wrap;
      justify-content: center;
      gap: 2rem;
    }
    .service-box {
      background-color: #ffffff;
      border-radius: 12px;
      box-shadow: 0 4px 8px rgba(0,0,0,0.1);
      padding: 1.5rem;
      width: 280px;
    }
    .service-box h3 {
      color: #4b5d3a;
    }
    @media (max-width: 768px) {
      .service-box {
        width: 90%;
      }
    }
  </style>
